let movie1 = {
    name: "coco",
    Image:"https://lumiere-a.akamaihd.net/v1/images/p_coco_19736_fd5fa537.jpeg?region=0%2C0%2C540%2C810"
}


let movie2 = {
    name: "moana",
    Image:"data:image/jpeg;base64,"
}


let movie3 = {
    name: "encanto",
    Image:"data:image/jpeg;base64,"
}

let movies = []
movies.push(movie1)
movies.push(movie2)
movies.push(movie3)

let movieContainer = document.getElementById('container')

movies.forEach((movie) =>
    movieContainer.innerHTML += `
 <div class="movie">
 <img src="${movie.Image}" alt="movie picture" />
 <h2>${movie.name}</h2>
 </div>
`)